object.script:
function dRF(o,p,t,r) return screen.drawRectF(o,p,t,r) end function inB(c) return input.getBool(c) end function inN(n) return input.getNumber(n) end function dT(f,b,z) return screen.drawText(f,b,z) end function sC(k,m,u) return screen.setColor(k,m,u) end k=1 i=1
function onTick() fire=inB(1) oil=inB(2) cyl=inB(3) gen=inB(10) start=inB(4) fuel=inB(5) trans=inB(6) ice=inB(7)
fp2=inN(11) o1=inN(16) o2=inN(17) st2=inB(25) th=inN(29) i1=inB(31) i2=inB(32) dr=inN(24) rps1=inN(2) rps2=inN(3) xfd=inB(1) ap=inN(23) pk=inB(18) output.setNumber(4, cu) tp1=inN(6) tp2=inN(7) dis1=inB(12) dis2=inB(13) batt=inN(9) fuelleft=inN(15) fig1=inB(19) fig2=inB(20) a=false end function onDraw()
w = screen.getWidth() -- Get the screen's width and height h = screen.getHeight() screen.setColor(0, 0, 0) screen.drawClear() screen.setColor(5, 5, 5)
screen.drawRectF(0, 1, (w/2), 7) screen.drawRectF(0, 9, (w/2), 7) screen.drawRectF(0, 17, (w/2), 7) screen.drawRectF(0, 25, (w/2), 7) screen.drawRectF((w/2+1), 1, (w/2), 7) screen.drawRectF((w/2+1), 9, (w/2), 7) screen.drawRectF((w/2+1), 17, (w/2), 7) screen.drawRectF((w/2+1), 25, (w/2), 7)
if fire then screen.setColor(255, 0, 0) screen.drawRectF(0, 1, (w/2), 7)
end
if fuel then screen.setColor(255, 20, 0) screen.drawRectF(0, 9, (w/2), 7)
end
if oil then screen.setColor(255, 0, 0) screen.drawRectF(0, 17, (w/2), 7)
end if ice then screen.setColor(255, 20, 0) screen.drawRectF(0, 25, (w/2), 7)
end
-- right section
if gen then screen.setColor(255, 0, 0) screen.drawRectF((w/2+1), 1, (w/2), 7)
end
if start then screen.setColor(255, 20, 0) screen.drawRectF((w/2+1), 9, (w/2), 7)
end if cyl then
screen.setColor(255, 0, 0) screen.drawRectF((w/2+1), 17, (w/2), 7)
end
if trans then
screen.setColor(255, 20, 0) screen.drawRectF((w/2+1), 25, (w/2), 7)
end screen.setColor(0, 0, 0) screen.drawText(1, 2, "fir") screen.drawText(1, 10, "fue") screen.drawText(1, 18, "oil") screen.drawText(1, 26, "ice") screen.drawText((w/2+3), 2, "gn") screen.drawText((w/2+3), 10, "st") screen.drawText((w/2+2), 18, "tmp") screen.drawText((w/2+2), 26, "gbx") end
